import React, { Fragment } from "react";
import DeckList from "./DeckList";

function Home({ handleBtns }) {
  return (
    <Fragment>
      <button
        type="button"
        class="btn btn-secondary"
        id="createDeckBtn"
        onClick={() => handleBtns}
      >
        Create Deck
      </button>
      <DeckList />
    </Fragment>
  );
}

export default Home;
